def _partially_consume_prefix(self, prefix, column):
        lines = []
        current_line = ""
        current_column = 0
        wait_for_nl = False
        for char in prefix:
            current_line += char
            if wait_for_nl:
                if char == '\n':
                    # Check the original indentation of the line before processing
                    indent_spaces = len(current_line) - len(current_line.lstrip(' '))
                    if current_column < column and current_column < indent_spaces:
                        res = ''.join(lines)
                        return res, prefix[len(res):]

                    lines.append(current_line)
                    current_line = ""
                    current_column = 0
                    wait_for_nl = False
            elif char == ' ':
                current_column += 1
            elif char == '\t':
                current_column += 4  # Assuming 4 spaces for each tab
            elif char == '\n':
                # Unexpected empty line
                current_column = 0
            else:
                # Indent is finished
                wait_for_nl = True

        return ''.join(lines), current_line
